import { Component, OnInit } from '@angular/core';
import { HttpHeaders, HttpResponse } from '@angular/common/http';
import { ActivatedRoute, Router } from '@angular/router';
import { combineLatest } from 'rxjs';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';

import { IFeeTransaction } from '../fee-transaction.model';

import { ASC, DESC, ITEMS_PER_PAGE, SORT } from 'app/config/pagination.constants';
import { FeeTransactionService } from '../service/fee-transaction.service';
import { FeeTransactionDeleteDialogComponent } from '../delete/fee-transaction-delete-dialog.component';

@Component({
  selector: 'jhi-fee-transaction',
  templateUrl: './fee-transaction.component.html',
})
export class FeeTransactionComponent implements OnInit {
  feeTransactions?: IFeeTransaction[];
  isLoading = false;
  totalItems = 0;
  itemsPerPage = ITEMS_PER_PAGE;
  page?: number;
  predicate!: string;
  ascending!: boolean;
  ngbPaginationPage = 1;

  constructor(
    protected feeTransactionService: FeeTransactionService,
    protected activatedRoute: ActivatedRoute,
    protected router: Router,
    protected modalService: NgbModal
  ) {}

  loadPage(page?: number, dontNavigate?: boolean): void {
    this.isLoading = true;
    const pageToLoad: number = page ?? this.page ?? 1;

    this.feeTransactionService
      .query({
        page: pageToLoad - 1,
        size: this.itemsPerPage,
        sort: this.sort(),
      })
      .subscribe(
        (res: HttpResponse<IFeeTransaction[]>) => {
          this.isLoading = false;
          this.onSuccess(res.body, res.headers, pageToLoad, !dontNavigate);
        },
        () => {
          this.isLoading = false;
          this.onError();
        }
      );
  }

  ngOnInit(): void {
    this.handleNavigation();
  }

  trackId(index: number, item: IFeeTransaction): number {
    return item.id!;
  }

  delete(feeTransaction: IFeeTransaction): void {
    const modalRef = this.modalService.open(FeeTransactionDeleteDialogComponent, { size: 'lg', backdrop: 'static' });
    modalRef.componentInstance.feeTransaction = feeTransaction;
    // unsubscribe not needed because closed completes on modal close
    modalRef.closed.subscribe(reason => {
      if (reason === 'deleted') {
        this.loadPage();
      }
    });
  }

  protected sort(): string[] {
    const result = [this.predicate + ',' + (this.ascending ? ASC : DESC)];
    if (this.predicate !== 'id') {
      result.push('id');
    }
    return result;
  }

  protected handleNavigation(): void {
    combineLatest([this.activatedRoute.data, this.activatedRoute.queryParamMap]).subscribe(([data, params]) => {
      const page = params.get('page');
      const pageNumber = +(page ?? 1);
      const sort = (params.get(SORT) ?? data['defaultSort']).split(',');
      const predicate = sort[0];
      const ascending = sort[1] === ASC;
      if (pageNumber !== this.page || predicate !== this.predicate || ascending !== this.ascending) {
        this.predicate = predicate;
        this.ascending = ascending;
        this.loadPage(pageNumber, true);
      }
    });
  }

  protected onSuccess(data: IFeeTransaction[] | null, headers: HttpHeaders, page: number, navigate: boolean): void {
    this.totalItems = Number(headers.get('X-Total-Count'));
    this.page = page;
    if (navigate) {
      this.router.navigate(['/fee-transaction'], {
        queryParams: {
          page: this.page,
          size: this.itemsPerPage,
          sort: this.predicate + ',' + (this.ascending ? ASC : DESC),
        },
      });
    }
    this.feeTransactions = data ?? [];
    this.ngbPaginationPage = this.page;
  }

  protected onError(): void {
    this.ngbPaginationPage = this.page ?? 1;
  }
}
<div>
  <h2 id="page-heading" data-cy="FeeTransactionHeading">
    <span jhiTranslate="createyoureventApp.feeTransaction.home.title">Fee Transactions</span>

    <div class="d-flex justify-content-end">
      <button class="btn btn-info mr-2" (click)="loadPage()" [disabled]="isLoading">
        <fa-icon icon="sync" [spin]="isLoading"></fa-icon>
        <span jhiTranslate="createyoureventApp.feeTransaction.home.refreshListLabel">Refresh List</span>
      </button>

      <button
        id="jh-create-entity"
        data-cy="entityCreateButton"
        class="btn btn-primary jh-create-entity create-fee-transaction"
        [routerLink]="['/fee-transaction/new']"
      >
        <fa-icon icon="plus"></fa-icon>
        <span jhiTranslate="createyoureventApp.feeTransaction.home.createLabel"> Create a new Fee Transaction </span>
      </button>
    </div>
  </h2>

  <jhi-alert-error></jhi-alert-error>

  <jhi-alert></jhi-alert>

  <div class="alert alert-warning" id="no-result" *ngIf="feeTransactions?.length === 0">
    <span jhiTranslate="createyoureventApp.feeTransaction.home.notFound">No feeTransactions found</span>
  </div>

  <div class="table-responsive" id="entities" *ngIf="feeTransactions && feeTransactions.length > 0">
    <table class="table table-striped" aria-describedby="page-heading">
      <thead>
        <tr jhiSort [(predicate)]="predicate" [(ascending)]="ascending" (sortChange)="loadPage()">
          <th scope="col" jhiSortBy="id"><span jhiTranslate="global.field.id">ID</span> <fa-icon icon="sort"></fa-icon></th>
          <th scope="col" jhiSortBy="date">
            <span jhiTranslate="createyoureventApp.feeTransaction.date">Date</span> <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col" jhiSortBy="transactionId.id">
            <span jhiTranslate="createyoureventApp.feeTransaction.transactionId">Transaction Id</span> <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col" jhiSortBy="eventProductOrder.id">
            <span jhiTranslate="createyoureventApp.feeTransaction.eventProductOrder">Event Product Order</span>
            <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col" jhiSortBy="eventServiceMapOrder.id">
            <span jhiTranslate="createyoureventApp.feeTransaction.eventServiceMapOrder">Event Service Map Order</span>
            <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col" jhiSortBy="event.id">
            <span jhiTranslate="createyoureventApp.feeTransaction.event">Event</span> <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col" jhiSortBy="organizationReservation.id">
            <span jhiTranslate="createyoureventApp.feeTransaction.organizationReservation">Organization Reservation</span>
            <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col" jhiSortBy="user.id">
            <span jhiTranslate="createyoureventApp.feeTransaction.user">User</span> <fa-icon icon="sort"></fa-icon>
          </th>
          <th scope="col"></th>
        </tr>
      </thead>
      <tbody>
        <tr *ngFor="let feeTransaction of feeTransactions; trackBy: trackId" data-cy="entityTable">
          <td>
            <a [routerLink]="['/fee-transaction', feeTransaction.id, 'view']">{{ feeTransaction.id }}</a>
          </td>
          <td>{{ feeTransaction.date | formatMediumDatetime }}</td>
          <td>
            <div *ngIf="feeTransaction.transactionId">
              <a [routerLink]="['/fee-transaction-id', feeTransaction.transactionId?.id, 'view']">{{ feeTransaction.transactionId?.id }}</a>
            </div>
          </td>
          <td>
            <div *ngIf="feeTransaction.eventProductOrder">
              <a [routerLink]="['/event-product-order', feeTransaction.eventProductOrder?.id, 'view']">{{
                feeTransaction.eventProductOrder?.id
              }}</a>
            </div>
          </td>
          <td>
            <div *ngIf="feeTransaction.eventServiceMapOrder">
              <a [routerLink]="['/event-service-map-order', feeTransaction.eventServiceMapOrder?.id, 'view']">{{
                feeTransaction.eventServiceMapOrder?.id
              }}</a>
            </div>
          </td>
          <td>
            <div *ngIf="feeTransaction.event">
              <a [routerLink]="['/event', feeTransaction.event?.id, 'view']">{{ feeTransaction.event?.id }}</a>
            </div>
          </td>
          <td>
            <div *ngIf="feeTransaction.organizationReservation">
              <a [routerLink]="['/organization-reservation', feeTransaction.organizationReservation?.id, 'view']">{{
                feeTransaction.organizationReservation?.id
              }}</a>
            </div>
          </td>
          <td>
            {{ feeTransaction.user?.id }}
          </td>
          <td class="text-right">
            <div class="btn-group">
              <button
                type="submit"
                [routerLink]="['/fee-transaction', feeTransaction.id, 'view']"
                class="btn btn-info btn-sm"
                data-cy="entityDetailsButton"
              >
                <fa-icon icon="eye"></fa-icon>
                <span class="d-none d-md-inline" jhiTranslate="entity.action.view">View</span>
              </button>

              <button
                type="submit"
                [routerLink]="['/fee-transaction', feeTransaction.id, 'edit']"
                class="btn btn-primary btn-sm"
                data-cy="entityEditButton"
              >
                <fa-icon icon="pencil-alt"></fa-icon>
                <span class="d-none d-md-inline" jhiTranslate="entity.action.edit">Edit</span>
              </button>

              <button type="submit" (click)="delete(feeTransaction)" class="btn btn-danger btn-sm" data-cy="entityDeleteButton">
                <fa-icon icon="times"></fa-icon>
                <span class="d-none d-md-inline" jhiTranslate="entity.action.delete">Delete</span>
              </button>
            </div>
          </td>
        </tr>
      </tbody>
    </table>
  </div>

  <div *ngIf="feeTransactions && feeTransactions.length > 0">
    <div class="row justify-content-center">
      <jhi-item-count [params]="{ page: page, totalItems: totalItems, itemsPerPage: itemsPerPage }"></jhi-item-count>
    </div>

    <div class="row justify-content-center">
      <ngb-pagination
        [collectionSize]="totalItems"
        [(page)]="ngbPaginationPage"
        [pageSize]="itemsPerPage"
        [maxSize]="5"
        [rotate]="true"
        [boundaryLinks]="true"
        (pageChange)="loadPage($event)"
      ></ngb-pagination>
    </div>
  </div>
</div>
